import React from 'react'

const Contacts = ({contacts}) => {
    return (
        <div>
            <center><h1>Contact List</h1></center>
            {contacts.map((app) => (
                <div class="card">
                    <div class="card-body">
                        <div class="card-title">ID: {app.id}</div>
                        <div class="card-title">Port: {app.port}</div>
                        <div class="card-title">Repo: {app.repo}</div>
                        <div class="card-title">Open API: {app.open_apiurl}</div>
                        <div class="card-title">Created Date: { Date(app.createDate)}</div>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Contacts
